import store from './store';
const state = store.getState();
const {data} = state;

export const getBrandNames = store =>{
    let x = this.props.data.map(d=> d.brand.name);
    return new Set([...x]);
}

export const maxPrice = store =>{
    let y = this.props.data.map(m=>m.price.offer_price.value);
        let val = y.reduce((accumulator,currentValue,idx)=> {
            if(idx === 0){
            accumulator = currentValue;
            return accumulator        
